/**
 * Получает data URL для эмоджи по коду
 * @param {string} emojiCode - код эмоджи (например, "1f600")
 * @returns {string|null} data URL или null
 */
export function getInlinePngEmojiUrl(emojiCode) {
    const code = emojiCode.toLowerCase();
    return INLINE_PNG_EMOJIS[code] || null;
}

/**
 * Получает список всех доступных кодов эмоджи
 * @returns {string[]} массив кодов эмоджи
 */
export function getAvailableInlinePngEmojis() {
    return Object.keys(INLINE_PNG_EMOJIS);
}

/**
 * Проверяет доступность эмоджи
 * @param {string} emojiCode - код эмоджи
 * @returns {boolean}
 */
export function hasInlinePngEmoji(emojiCode) {
    return emojiCode.toLowerCase() in INLINE_PNG_EMOJIS;
}
